import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import "bootstrap/dist/css/bootstrap.min.css";
import { useState, useEffect } from "react";
import Carousel from "react-bootstrap/Carousel";
import Casa from "../img/Casa.jpg";
import Telefoni from "../img/telefoni.jpg";
import Uomo from "../img/retemobile.jpg";
import { Button } from "react-bootstrap";
import Card from "react-bootstrap/Card";

const HomePage = () => {
  const [index, setIndex] = useState(0);
  const [isLoading, setLoading] = useState(false);

  const handleSelect = (selectedIndex) => {
    setIndex(selectedIndex);
  };

  useEffect(() => {
    function simulateNetworkRequest() {
      return new Promise((resolve) => {
        setTimeout(resolve, 2000);
      });
    }

    if (isLoading) {
      simulateNetworkRequest().then(() => {
        setLoading(false);
      });
    }
  }, [isLoading]);

  const handleClick = () => setLoading(true);
  return (
    <>
      <Navbar expand="lg bg-warning">
        <Container className="ms-0">
          <Navbar.Brand href="#home" className=""></Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar">
            <Nav className="me-auto text-center">
              <Nav.Link href="#home" className="text-white">
                FlySim
              </Nav.Link>
              <Nav.Link href="#home" className="text-white">
                Dove siamo ?
              </Nav.Link>
              <Nav.Link href="#home" className="text-white">
                Chi siamo?
              </Nav.Link>

              <Nav.Link href="#home" className="text-white">
                Login
              </Nav.Link>
              <Nav.Link href="#home" className="text-white">
                Registrati
              </Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Carousel activeIndex={index} onSelect={handleSelect} className="mt-0">
        <Carousel.Item>
          <img className="d-block w-100" src={Casa} alt="first-slide" style={{ height: "500px", objectFit: "cover" }} />
          <Carousel.Caption>
            <h3 className="text-warning fw-bold" style={{ fontSize: "40px" }}>
              Rete Fissa
            </h3>
            <p className="text-warning fw-bold" style={{ fontSize: "25px" }}>
              Tutta la velocità della fibra , ad un prezzo accessibile a tutti.
            </p>
            <Button variant="warning" disabled={isLoading} onClick={!isLoading ? handleClick : null}>
              {isLoading ? "IN VIAGGIO…" : "VIENI A SCOPRIRLO"}
            </Button>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img src={Uomo} alt="second-slide" style={{ height: "500px", objectFit: "cover" }} className="d-block w-100" />
          <Carousel.Caption>
            <h3 className="text-warning fw-bold" style={{ fontSize: "40px" }}>
              Rete Mobile
            </h3>
            <p className="text-warning fw-bold" style={{ fontSize: "25px" }}>
              Lo sapevi il nostro servizio 5G è differente ? vieni a scoprirlo.
            </p>
            <Button variant="warning" disabled={isLoading} onClick={!isLoading ? handleClick : null}>
              {isLoading ? "IN VIAGGIO…" : "VIENI A SCOPRIRLO"}
            </Button>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img src={Telefoni} alt="second-slide" style={{ height: "500px", objectFit: "cover" }} className="d-block w-100" />
          <Carousel.Caption>
            <h3 className="text-warning fw-bold" style={{ fontSize: "40px" }}>
              Scegli il telefono che fa per te
            </h3>
            <p className="text-warning fw-bold" style={{ fontSize: "25px" }}>
              IPHONE , SAMSUNG , XIAOMI e molti altri...
            </p>
            <Button variant="warning" disabled={isLoading} onClick={!isLoading ? handleClick : null}>
              {isLoading ? "IN VIAGGIO…" : "VIENI A SCOPRIRLO"}
            </Button>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>

      <div className="container mt-5 ms-1">
        <div className="row">
          <Card style={{ width: "18rem", height: "15rem" }}>
            <Card.Body className="text-center">
              <Card.Title>Perchè segliere FlySim?</Card.Title>
              <Card.Text>Perchè siamo la linea fissa e mobile più veloce d'italia.</Card.Text>
            </Card.Body>
          </Card>
        </div>
      </div>
    </>
  );
};

export default HomePage;
